// a simple footer for the app

import React from 'react';

const Footer = () => {
    return (
        <footer>
            <hr/><hr/>
            <p>Coded by: Definitly not Stephen Squire</p>
            <p> &copy; Copyright 2022, No Rights Reserved </p>
            <p>Zero credit to Yelp for the sample dataset used for testing</p>
            <p>Not built using create-react-app</p>

        </footer>
    )
}

export default Footer;
